import React from "react";

const Navbar = () => {
  return (
    <nav className="bg-blue-900 text-white px-8 py-4 flex justify-between items-center">
      <h1 className="text-xl font-bold">Bharat Internship</h1>
      <div className="space-x-6">
        <a href="/" className="hover:text-gray-300">Home</a>
        <a href="/find" className="hover:text-gray-300">Find Internship</a>
        <a href="/industry" className="hover:text-gray-300">For Industries</a>
        <button className="bg-white text-blue-900 px-4 py-2 rounded">Login</button>
      </div>
    </nav>
  );
};

export default Navbar;
